import React from 'react'
import './MainContent.css'
import {XYPlot, LineSeries} from 'react-vis';

function MainContent() {

    const data = [
        {x: 0, y: 1},
        {x: 1, y: 2},
        {x: 2, y: 3},
        {x: 3, y: 4},
        {x: 4, y: 5},
        {x: 5, y: 2},
        {x: 6, y: 7},
        {x: 7, y: 8},
        {x: 8, y: 9},
        {x: 9, y: 10}
      ];



    return (
<div className="test">
<XYPlot height={300} width={300}>
          <LineSeries data={data} />
        </XYPlot>
</div>

    )
}

export default MainContent
